import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from './components/Home';
import Aggiungi from './components/Aggiungi';

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/aggiungi" element={<Aggiungi />} />
    </Routes>
  );
}

export default App;
